import React, { Component } from 'react';

class BoardState extends Component {
    constructor() {
        super();
        this.state = {
          board: []
        };
      }

    componentDidMount() {
        fetch('/maindata')
          .then(res => res.json())
          .then(board => this.setState({board}, () => console.log('Customers fetched...', board)));
      }
    render () {
        return (
            <div>
                <h1>
                    header goes in here
                    </h1> 
                </div>
        );
    }
}

export default BoardState;
